    W += c[48]*39.948000; /*AR */
    W += c[49]*43.089240; /*C3H7 */
    W += c[50]*44.097210; /*C3H8 */
    W += c[51]*43.045610; /*CH2CHO */
    W += c[52]*44.053580; /*CH3CHO */
    W += c[53]*20.006370; /*HF */
    W += c[54]*18.998400; /*F */
    W += c[55]*37.996800; /*F2 */
    W += c[56]*34.033460; /*CH3F */
    W += c[57]*52.023890; /*CH2F2 */
    W += c[58]*70.014320; /*CHF3 */
    W += c[59]*88.004750; /*CF4 */
    W += c[60]*33.025490; /*CH2F */
